A hexagon is inscribed in a circle: [asy]
pair pA, pB, pC, pD, pE, pF, pO;
pO = (0, 0);
pA = pO + dir(-10);
pB = pO + dir(60);
pC = pO + dir(130);
pD = pO + dir(170);
pE = pO + dir(-160);
pF = pO + dir(-80);
draw(pA--pB--pC--pD--pE--pF--pA);
label("$105^\circ$", pF, N * 2);
label("$110^\circ$", pB, SW * 1.5);
label("$\alpha$", pD, E);
draw(circle(pO, 1));
[/asy] What is the measure of $\alpha$, in degrees?

Two runners, $A$ and $B,$ start at a point $O$ on a linear track, and start running in the same direction.  Runner $B$ runs three times as fast as runner $A.$  An observer stands at point $P$ so that $\overline{OP}$ is perpendicular to the track.  Find the maximum of $\angle APB,$ in degrees.

[asy]
unitsize(2 cm);

pair A, B, O, P;

A = (0.4,0);
B = (1.2,0);
O = (0,0);
P = (0,1);

draw((-0.5,0)--(2,0));
draw(O--P);
draw(P--A);
draw(P--B);

label("$A$", A, S);
label("$B$", B, S);
label("$O$", O, S);
label("$P$", P, N);
[/asy]

In the diagram, two circles, each with center $D$, have radii of $1$ and $2$. The total area of the shaded region is $\frac5{12}$ of the area of the larger circle. How many degrees are in the measure of (the smaller) $\angle ADC$?
[asy]
size(4cm);
defaultpen(linewidth(0.75));
real adc = 100;
pair d = (0, 0); pair a = 2 * dir(100); pair c = (2, 0);
path inner = arc(d, a/2, c/2, CW);

path outer = arc(d, c, a, CCW);
guide region1 = (a--a/2)..inner..(c/2--c)..outer..cycle;
guide region2 = arc(d, a/2, c/2, CCW)..(c/2--d--a/2)..cycle;
fill(region1, gray(0.75));
fill(region2, gray(0.75));
draw(unitcircle); draw(scale(2) * unitcircle);
draw(a--d--c);
label("$A$", a, N); label("$C$", c, E); label("$D$", d, NE);
[/asy]

