Quadrilateral $ABCD$ is a square with area 16 square inches. The figure represents the pieces of a Chinese tangram in which all the triangles are isosceles and piece "e'' is a square. What is the area of the gray piece, in square inches?

[asy]
fill((2,0)--(4,2)--(4,0)--cycle,gray(.7));
draw((0,0)--(0,4)--(4,4)--(4,0)--cycle,linewidth(1));
draw((0,0)--(4,4),linewidth(1));
draw((1,1)--(2,0)--(4,2),linewidth(1));
draw((0,4)--(3,1)--(3,3),linewidth(1));
label("$A$",(0,4),W);
label("$B$",(4,4),E);
label("$C$",(4,0),E);
label("$D$",(0,0),W);
label("e",(2,1));

[/asy]

Rectangle $ABCD$ has center $O$ and $AB/AD=k$. A point is randomly chosen from the interior of rectangle $ABCD$. What is the probability that it is closer to $O$ than to any of the four vertices?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

In the diagram below, we have $\overline{ST}\parallel\overline{QR}$, $\angle P= 40^\circ$, and $\angle Q =35^\circ$. Find the measure of $\angle STR$ in degrees.

[asy]
pair P,Q,R,SS,T;
Q = (0,0);
R = (1,0);
P = (1.1,0.5);
SS = 0.6*P;
T = R + 0.6*(P-R);
draw(T--SS--P--R--Q--SS);
label("$P$",P,N);
label("$S$",SS,NW);
label("$Q$",Q,S);
label("$R$",R,S);
label("$T$",T,ENE);
[/asy]
